import React from 'react';
import { BrowserRouter , Routes, Route} from 'react-router-dom';
import './App.css';
import NavBar from './navBar/NavBar.js';
import styles from './cssPage/potfolio.module.css';
import Container from 'react-bootstrap/Container';
import Intro from './sections/Intro.js';
import Button from 'react-bootstrap/esm/Button.js';
import Portfolio from './sections/Portfolio.js';
import FoodAppShowcase from './sections/FoodAppShowcase.js';
import Footer from './sections/Footer.js';

function App() {
  return (
    <BrowserRouter>
      <div className='' >
        <NavBar/>
<div >
       <Routes>
        <Route path='/' element={<Portfolio/>}/>
        <Route path='/food/:id' element={<FoodAppShowcase/>}/>
        <Route path='/about' element={<Ab/>}/>
       </Routes>
       <Footer/>

      </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
